import './App.css';
import Navc from "./component/Navc";

import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Home from './pages/Home';
import Login from './pages/Login';
import Productview from './pages/Productview';
import Cart from './pages/Cart';

function App() {
  return (
  <>

   <Navc/>
   <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/home" element={<Home />} />
      <Route path="/login" element={<Login />} />
      <Route path="/cart" element={<Cart imgsrc="https://www.google.com/search?q=cart+image&client=firefox-b-d&channel=trow5&sxsrf=APq-WBtICU3oh2Zfmzbv1R_psGJgA2G9HA:1645296287404&tbm=isch&source=iu&ictx=1&vet=1&fir=yB7PJeIJ_N4Y7M%252CHEItgy9lOBknvM%252C_%253B5IL5hq4qeUTLaM%252ClzxwRs4h4dHJiM%252C_%253B0GJka-QJ0pqDmM%252CdmoZ_TSJLdF3zM%252C_%253Boo3mrEvo_PDyOM%252C7o7njvpeJQjXVM%252C_%253By7O6CdF7au3LLM%252CGnYacqqEmZoyGM%252C_%253BFSOxZWhz4b8siM%252CEYYdO6RcnAc15M%252C_%253BjXs_zNAsVlY1zM%252CIgYYNgfpIWIduM%252C_%253B3cH2-fcwRPiZ8M%252CIFAdRlCWevMWcM%252C_%253BPhYzo8JgPT_z6M%252CHEItgy9lOBknvM%252C_%253Br6IDp4ueXOx6dM%252CkdNULVCFzltaIM%252C_%253BvzatM16DW74WOM%252CUUNq5E3m9q-B7M%252C_%253B_5RPcVJVYMGDcM%252CIFAdRlCWevMWcM%252C_%253BZWfwGBvHVTfajM%252CkxeKlXS5ddkZ4M%252C_%253B_bl2ZAUK8MZ_EM%252Clp-2AvnMhOFcsM%252C_%253Bwqit3-JFW9PX4M%252CIFAdRlCWevMWcM%252C_%253BbtXYZV8MorFKDM%252CsPl2mQMoery-9M%252C_&usg=AI4_-kQxNru-3HHAzLkFQWnras-bzLBFyg&sa=X&ved=2ahUKEwjz2oqmtoz2AhWDyosBHXcgBR8Q9QF6BAg1EAE#imgrc=vzatM16DW74WOM" />} />
      <Route path="/productview" element={<Productview />} />
    </Routes>

    </>
  )  
}

export default App;
